import React from 'react';
import BandForm from '../components/Band/BandForm';
import ButtonRandom from '../components/ButtonRandom';


const FBand = () => {
    return (
        <>
            <ButtonRandom />
            <div>
                <BandForm />
            </div>
        </>
    );
};

export default FBand;
